INSERT INTO public.events (title,body,date,id,owned_by) VALUES ('Test future event', 'Negant hoc signiferos esset quod.', 'Sun Nov 12 2028', 'c8350ce6-3c40-5840-a87b-7e6c453eff95', NULL), ('Ei morborum vidis hominest sed suavit ob epicur.', 'Vivenimic ex sed fore approbaris uto redeam.', 'Sun Nov 12 2028', '96393ab4-cbd2-51bc-a1f8-0e783aa08977', NULL), ('Et tenebat neque et non sapienae iis quibus.', 'Lat magis amus libere dolorum quae.', 'Sun Nov 12 2028', 'b0af2f0f-203c-5c18-8321-2b4ea55d95f4', NULL), ('Laborum earum censes non foderate neque.', 'Quo constantia accessio publictorquat quae.', 'Sun Nov 12 2028', 'bfe5d8f5-51bd-582e-b735-a8ae497a8497', NULL), ('Atius sapiendum ab relin potestia ipso plane voluptat.', 'Dici tollitat intellegen virtutum sentiendo.', '2020-09-21T20:34:55.000Z', '7e984c49-34ea-553f-a70d-970045067a66', NULL), ('Vicinvitup et fieri es detere neque, defuit ilius et sic ratio conficiandae.', 'Abillus dixitiae as eam es idonissim, quod pernantur hosti ad correctasse.', '2020-09-05T09:12:17.000Z', '1c5aa4c8-ab0f-5859-94a4-c80ea99c4ed5', NULL), ('Atisque animpedien ea rationem potesse hanc.', 'Veniracut ipsa epici consequenter de.', '2020-04-04T03:48:09.000Z', '90957a21-f7cf-5a5a-b036-5d995178ef16', NULL), ('Contra anim cogitatum si iucunt.', 'Videm numquam de perspici eret scientiam refere nec.', '2020-07-15T06:11:50.000Z', 'e69e940b-0961-55f0-9e51-12f83eab3818', NULL), ('Discent nam endae factori gravit et dixerudit quam, ipsa dicebit vetere sit logikh.', 'Suo es putarbitram efficil eadem bene laboribus.', '2020-09-13T20:45:01.000Z', '786bb48a-3fbc-5955-8150-030cd32c45d2', NULL), ('Praeterendum tantum et correcte docent neque nostram, esse morbos ne non regulas de.', 'Vita viveremus inerin earum vivamicos iudicab.', '2020-02-26T13:39:39.000Z', '87949f80-6de1-5a9f-8c0f-4d85f4e3a6ac', NULL), ('Mihi phaedrum quam nostrum voluptatis diligitia, si rer clamatem quo quod iustitio intellegen.', 'Fruitur nam quaeso era omne, inem ac industria nostra in.', '2020-11-19T10:25:27.000Z', '2a87438b-7342-5e6a-9773-4f89dfb89746', NULL), ('Qui quidem segnitud ne omnium, non actantum vult etiam medium.', 'Ipse gessis ime navi in, facet facere ut quidem et autem quid cum.', '2020-02-02T13:35:31.000Z', '4986d934-10e8-5ba8-a5c5-df0b14601364', NULL), ('Commodo idine medium ipsa at interea gravitatque cura, etiam quodsi procedunt modo aut et retinavit.', 'In sempiter accedis se dicta si simplicab videbime.', '2020-10-06T09:24:28.000Z', '20c75709-1076-5486-8f05-1a29960a5a1e', NULL), ('Patriam ex metuque as arum laudatortum et.', 'Perit partus eptrices fama asper.', '2020-01-09T12:43:08.000Z', '80127c21-a5f8-5552-9c84-557b8f5a3101', NULL), ('Ut fructuosamen ferrent aut nullam doloraris timum, amus velinfinit vivero intus iderudin habet qui tu.', 'Ea ipsam ationest nunc legiturus abo etiam.', '2020-04-16T15:28:25.000Z', 'f37778cf-8d10-5fd9-ae98-88846f895313', NULL), ('A hoc a recor et memin.', 'Utere quamquam endi tum succum quia, esse pariendisplic et factis ars et.', '2020-03-07T14:14:27.000Z', 'b1318ef9-ac3a-535a-8913-12a493368dd0', NULL), ('Multi idinum aut cupidis philos ilior, latinum quidem e ex iud.', 'Omnino appellat hoc constituti quam recte ile, is obligandum dedita eadem voluptatem ales statue sublatum.', '2020-12-20T11:49:19.000Z', '6de827b5-0c0c-5878-af5d-5a324db22507', NULL), ('Et confirmiser videten aut paulo.', 'Ex res fore quodsi neque quam efflores.', '2020-08-20T07:11:59.000Z', 'ec481d48-36e9-5133-ad3f-dc863936e70d', NULL), ('Quod etiam repellere admodo iis certae, modicur ophia non molest dolornam declinabit ari voluptatem.', 'Melius vos nostrum labiti seditus, modo contra et nec video sentento alesta inter.', '2020-11-07T22:35:38.000Z', '6b6cd32f-b7a4-5e27-bcc6-d2ea9087c4f7', NULL);
